import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <main>
      THIS IS THE HOMEPAGE
      <nav>
        <Link to="/player/info">
          Player Info (not done) petemango autofill combobox
        </Link>
        <Link to="/team/info">
          Team Info (kinda stupid cause who's looking this up?)
        </Link>
        <Link to="/player/averages">
          Player Averages (may not be the most accurate - api fault)
        </Link>
      </nav>
    </main>
  );
}

export default Home;
